import React from "react";
import Header from '../header/Header'
import Footer from "../footer/Footer";
const Dashboard=()=>{


    return (<>
        <header>
            <Header/>
        </header>
        <main>
            <nav>
            <a class="active" href="#home">Home</a>
  <a href="#news">News</a>
  <a href="#contact">Contact</a>
  <a href="#about">About</a>
            </nav>
        </main>
        <footer>
            <Footer/>
        </footer>
    </>);
};

export default Dashboard;
